INSERT INTO `feedback` (`user`, `feedback`) VALUES
('sodiq.akinjobi@gmail.com_', 'Thank youuuuu'),
('sodiq.akinjobi@gmail.com_', 'ffffff'),
('ioluwayelu@gmail.com', 'I really learnt from this challenge. Am grateful to all the teachers and other person that made the program a success\r\n\r\n'),
('Onyealidavidcn@gmail.com', 'Thanks to all the organizers and the tutors for a great learning experience.\r\nI look forward to the next 30daysofcode challenge.\r\n'),
('emmanueloluwatobi2000@gmail.com', 'The challenge is really helpful....it has helped me to develop my algorithms skills and know more about python programming language.....I would like the next challenge to be more on Object Oriented Programming. Thanks...Teapy'),
('ekeneanthony85@gmail.com', 'It was a satisfactory experience. I\'m really grateful to everyone in the ecx team. I\'m going to miss the feeling of waking up in the morning and looking forward to the day\'s task, and checking the leaderboard over and over again for changes in scores. Thank you all '),
('rajimustapha30@gmail.com', 'Words can\'t envisage the amount of gratitude I have for you guys, it has really been a nice and educating time'),
('kodiezzy@gmail.com', 'I will like to appreciate all my tutors in frontend and the ecx chairman for this great opportunity to learn and improve my skills. This has indeed been the best 30 days of my life. I won\'t forget #30daysofcode in a hurry.'),
('jolaiyaemmanuel@gmail.com', 'Best decision have made so far is participating in this challenge! The experience is unexplainable'),
('newtonjohn043@gmail.com', 'I love youuuuu, too much, three much four much..\r\n\r\nIt was a really nice experience\r\n\r\nCan we have a data science boot camp or something to learn more'),
('newtonjohn043@gmail.com', 'Ose, Fortune, Babatunde koiki, sodiq, Roy,.. y\'all are the best!!\r\n\r\nYour critical comments are killers though but it made me better\r\n\r\nGeek tutor, you\'re a great leader I must say!!'),
('emmaoge63@gmail.com', 'My total points did not increase ðŸ˜’ðŸ˜’'),
('samuelbamgbola@gmail.com', 'The 30 day coding experience was great. I started day 15 but was able to submit 22 days out of the 31. Though, the reviews would have gone a long way helping if I got a sample code after they have been marked \'cause some reviews only pointed out errors but not how to correct them. Overall it was splendid. The competition made it more exciting and I\'m looking forward to more of this, maybe half yearly (every 6 months). Thanks a lot to the tutors and crew members. '),
('alameenraji31@gmail.com', 'This has been the best experiences have had since I started programming. I really gained alot and it has been the thing I wake up every morning to look forward to for the past 30 days..I want to thank the organisers for and the tutors for putting together a wonderful experience for programmers.'),
('mofeoluwalijadu@gmail.com', 'Nice challenge. More than the challenge, I loved the interaction on the support group more ðŸ˜‰. Thanks to the team also ðŸ‘ðŸ‘ðŸ‘\r\n\r\nAlso, there was this time a mark was deducted from my work and the tutor said the mark was deducted cos I disturbed him while requesting for the review ðŸ¤£ðŸ¤£ðŸ¤£. It was fun though.\r\n\r\nAlso a big thanks for making the challenge an open one and not just UNILAG based ðŸ˜Ž\r\n\r\nLong live DSC_Unilag and ECX '),
('mofeoluwalijadu@gmail.com', 'Nice challenge. More than the challenge, I loved the interaction on the support group more ðŸ˜‰. Thanks to the team also ðŸ‘ðŸ‘ðŸ‘\r\n\r\nAlso, there was this time a mark was deducted from my work and the tutor said the mark was deducted cos I disturbed him while requesting for the review ðŸ¤£ðŸ¤£ðŸ¤£. It was fun though.\r\n\r\nAlso a big thanks for making the challenge an open one and not just UNILAG based ðŸ˜Ž\r\n\r\nLong live DSC_Unilag and ECX '),
('josephtobi53@gmail.com', 'The lack of lengthy correction I guess\r\nSummarize correction is not easy to understand\r\nBut I totally understand\r\nThx alot\r\nCos I learnt alot'),
('ukuanovweogheneovo@gmail.com', 'lol, i am so excited that i have forgotten all my grievances. what could have possibly gone wrong, yeah, the marking, it wasn\'t real time, being top on the leader-board depended on a lot on factors apart from our grades, eg, the rate at which the teachers mark (i clearly understand that they are humans and not robots). and i loved the response you guys gave to  our complaint, most especially on the complaint of constructive feedback, telling us what we did wrong at each task, it made us better. '),
('owoeyepo@gmail.com', 'The challenge was an awesome experience, I got to meet new people and revive old friendships.\r\nIt started as something I got involved with because I was bored but it became something I didn\'t want to end.\r\nI remember looking at my first 22 thinking: \"Wow, someone out there actually thought my code was impressive enough to get a bonus\" and on the other end of the spectrum, I remember getting my first 16 because I misread the instructions and interpreted the examples incorrectly... at that point, '),
('lumiyken@gmail.com', 'the experience was awesome. I got to learn a lot. The only issue was that the tasks were sometimes marked late at some point. Apart from that, it was great! Thank you ECX '),
('lumiyken@gmail.com', 'the experience was awesome. I got to learn a lot. The only issue was that the tasks were sometimes marked late at some point. Apart from that, it was great! Thank you ECX '),
('olumidenwosu@gmail.com', 'the experience was awesome. I got to learn a lot. The only issue was that the tasks were sometimes marked late at some point. Apart from that, it was great! Thank you ECX '),
('isaacfayemi305@gmail.com', 'Great experience, can we have more of this? Regularly?. Also i think we may need more volunteers to make response time faster'),
('babby833@gmail.com', 'I really enjoyed the challenges not only bcos it made me develop myself as a programmer but raised my logical thinking approach to a new level. \r\nI hope to see more of these if the administration wants to host another challenge'),
('fasasisherif@gmail.com', 'I\'ve learnt a lot just in 30 days. What I learnt is beyond my expectation. I love all the tutors from the depth of my heart and all those that made this possible. No word is substantial to show my feeling. I\'ve improved so much in Frontend. Geektutor is a man of honour.\r\nMore power to your elbow.'),
('fagoroyeayomide@gmail.com', 'I am grateful honestly for this challenge. Thank you ECX. I was always scared of taking challenges when I started. Though I am still a beginner but was able so solve the problems with reasonable accuracy. A heavy boost for me I swear. Thank you Dsc'),
('fagoroyeayomide@gmail.com', 'I am grateful honestly for this challenge. Thank you ECX. I was always scared of taking challenges when I started. Though I am still a beginner but was able so solve the problems with reasonable accuracy. A heavy boost for me I swear. Thank you Dsc'),
('fagoroyeayomide@gmail.com', 'I am grateful honestly for this challenge. Thank you ECX. I was always scared of taking challenges when I started. Though I am still a beginner but was able so solve the problems with reasonable accuracy. A heavy boost for me I swear. Thank you Dsc'),
('fagoroyeayomide@gmail.com', 'I am grateful honestly for this challenge. Thank you ECX. I was always scared of taking challenges when I started. Though I am still a beginner but was able so solve the problems with reasonable accuracy. A heavy boost for me I swear. Thank you Dsc'),
('Charltonujic@gmail.com', 'Was a good experience for the few days I engaged. Learnt a lot of new and cool stuffs, real life hands-on experience that I did not learn while learning. Oh and by the way, I was in the python track.\r\nSome of the challenges I appreciate alot are: Password generator, email validation, verification of nigerian phone number.\r\n\r\nOne major flaw I disliked is how the challenge was seen as a competition rather that learning. \r\nReward is the motivation for any game/challenge. \r\nI learnt about the challe'),
('Charltonujic@gmail.com', 'Was a good experience for the few days I engaged. Learnt a lot of new and cool stuffs, real life hands-on experience that I did not learn while learning. Oh and by the way, I was in the python track.\r\nSome of the challenges I appreciate alot are: Password generator, email validation, verification of nigerian phone number.\r\n\r\nOne major flaw I disliked is how the challenge was seen as a competition rather that learning. \r\nReward is the motivation for any game/challenge. \r\nI learnt about the challe'),
('grggmmnl@gmail.com', 'The ECX was great, it helped me to learn a lot both online when trying to solve a problem and with each other when I see new things being implemented in other people\'s code. It also taught me time management and keeping up to milestones. The project also showed my weakness and gave tips on how I can go about it, it challenged my mind to think outside the box, making me discover new things. It also made me not to waste my time. I feel the last thirty days were the most productive days in my life '),
('nwabudedavid@gmail.com', 'Yes.\r\nYou guys did really well.\r\nConsider improving the overall structure of the program it\'s a unique and nice initiative. The social media management was really good. \r\nConsider creating a support like Google support or stackoverflow for example, where helps can be used by others without much noise like in the WhatsApp. \r\nThis website, kudos. It was impromptu but you could make its overall structure better. \r\nI applaud the tutors they deserve remuneration. Marking is not easy. And I propose th'),
('fuadgafarnusaybah@gmail.com', 'I love ecx'),
('lorddro1532@gmail.com', 'The way you held the challenge was awesome. Gave us all something to keep our hands busy and I\'m glad i partook. I just wish we had more tutors to make the marking faster and you should have left the deadline for day 29 and below till 12 but it is what it is. All in all, very good job. Thumbs up to everyone who took part in organizing it.I hope I get to a level where I\'ll be able  join you in organizing this. :)\r\n'),
('badirualaba@gmail.com', 'It was awesome. Really learned a lot with the challenge.'),
('emmanueloluwatobi2000@gmail.com', 'The challenge has been helping me build my algorithm skills in Python and it has made me understand the language more.....Thanks to ECX for this...'),
('magicmicheal4@gmail.com', 'Yeah... It was generally okay but I didn\'t like the lack of Test cases, it made many questions frustrating to answer'),
('aderogbaabibat@gmail.com', 'Welldone tutors. \r\nBut i couldn\'t get my cert. And i submitted more than 15 designs. '),
