(37, 'emanuelmechie@gmail.com', 'python', 'https://repl.it/@emmanuelmechie/Average ', 'Day 1', '', 13, '2020-05-01', 'As much as is possible do not use special strings in python as variable names e.g sum int dict list. In the same light do not use the same name for variables and functions.\r\nNo docstring or comment. Try to catch possible errors from user input in your code.\r\n-I', 1, 'Intermediate'),
