(44, 'devops@gmail.com', 'backend', 'https://github.com/olumidayy/30daysOfCode/edit/master/Day%201.js', 'Day 1', '', 13, '2020-05-01', 'Good clean code. It is important to know though than no number has a perfect divisor greater than half its value, therefore, the for loop would only have to run from i=1 to i=num/2. Also, as long as it is not required to setup server, all submissions should be repl.it links.\r\n\r\nBee', 1, 'Beginner'),
