(49, 'amirolatunbosun@yahoo.com', 'backend', 'https://code.sololearn.com/wa1X0sev9gj0/?ref=app', 'Day 1', 'This was done from a phone ..just started learning php', 14, '2020-05-01', 'Excellent code. for future tasks involving checking divisors, it is important to know that no number has a perfect divisor after half its value. so it is sufficient to loop from i=1 to i<=number/2. Also, the preferred platform to make submission would be repl.it.\r\n\r\nBee', 1, 'Beginner'),
