(113, 'kingtoluwalope@gmail.com', 'backend', 'https://repl.it/@blayziken/Day-1-Intermediate', 'Day 1', '', 13, '2020-05-01', 'Your use of hashmaps shows you have a reasonable level of data-structures and algorithms. But your use of hash maps trades code readability for a very little improvement if any in processing time complexity when compared with javascripts inbuilt array method for matching characters.\r\n\r\n  const scrabble = (str1, str2) => {\r\n    const [arr1, arr2] = [str1.split(\'\'), str2.split(\'\')];\r\n    return arr2.every( x => arr1.indexOf(x)===-1 ? false: arr1.splice(arr1.indexOf(x),1));\r\n};\r\n\r\nconst { PerformanceObserver, performance } = require(\'perf_hooks\');\r\nlet t1=performance.now();\r\nscrabble(\'jigokuhen\',\'jigen\');\r\nscrabble(\'i am rain\', \'raining\');\r\nlet t2=performance.now();\r\nconsole.log(t2-t1);\r\n\r\nYou may use the above to compare the execution time the code sample above with yours.\r\n\r\nJavascript has a lot of methods which ease the difficulty in performing some tasks at the same time providing speed and efficiency. Study them', 1, 'Intermediate'),
