(211, 'adedibuprecious@gmail.com', 'backend', 'https://github.com/Preshy-Jones/30DAYOFCODE-2.0/blob/master/day1beg.js', 'Day 1', 'Backend Beginner Day 1', 13, '2020-05-01', 'Firstly, I will have to acknowledge your ingenuity in figuring out if a number is perfectly divisible by another number. The method you used is quite ingenious, I probably wouldnt have thought of that in your shoes. With that said, javascript and most programming languages have a modulus operator(%) it returns the remainder if a number were to be divisible by another number. read up on this. It is a very useful operator.\r\n\r\nBee', 1, 'Beginner'),
