(688, 'adedibuprecious@gmail.com', 'backend', 'https://repl.it/@PreshyJones/DAY4BACKEND-INTERMEDIATE', 'Day 4', 'Backend intermediate', 11, '2020-05-04', 'Good solution, but note the following. Firstly, When asked to return the list of primes within a range, the optimal solution is to use a prime sieve. There are a number of prime sieves which could have been implemented. Secondly, in your solution, you checked if if each number was a divisor of the number you are testing before finally checking to see if any number was a perfect divisor. This method is inefficient as there is no need to keep on checking if a number is divisible by other numbers once it has been divided by one. if you were checking if a number like 100 was a prime, it would be a waste of time after it has been divisible by 2. With that said, I would ask you to research on \"break\" and \"continue\" in javascript. Keep practicing and keep up the good work\r\n\r\n-Bee', 1, 'Intermediate'),
