(751, 'olakehinde59@gmail.com', 'backend', 'https://repl.it/@olakehinde/Optimus-prime', 'Day 4', '', 12, '2020-05-04', 'Good job. But note the following. Firstly, never use nested function(writing functions inside another function) they are inefficient and could lead to a drop in user experience. Write the function outside the other function and call it when you need it. Secondly, When asked to return a list of prime numbers in a range, The optimal solution would be to implement a prime Sieve. This would eliminate the need for trial and error division when picking out the primes. you may read up on them; there are various kinds of prime sieves that could be employed.\r\n\r\n-Bee', 1, 'Intermediate'),
