(901, 'ayomiposolaja@gmail.com', 'backend', 'https://repl.it/@solajaayomipo/Day5', 'Day 5', '', 14, '2020-05-05', 'While your solution isnt the optimal, I do like your approach. Its the first of its kind so far. Since we are looking for values A+B=num, A great solution though would be to for a to have all occurences of 7 be changed to say 5 and all other values changed to 0 while B having only all occurrences of 7 be changed to 2. Choosing 5 and 2 are not necessary but any two positive integers that add to 7. This would eliminate the need for subtraction for a very large integer.  Read more about it here.  https://codingcompetitions.withgoogle.com/codejam/round/0000000000051705/0000000000088231\r\nKeep up the good work.\r\n\r\n-Bee', 1, 'Intermediate'),
(904, 'Oparaben1@gmail.com', 'mobile', 'https://github.com/OparaBenjamin/RealNewsApp', 'Day 5', 'Would have loved to use the recommended stacks but due to the power issue I face, I only use the power supply I get at night to do my task. I can\'t be learning those languages and be executing these types of tasks same time. Consuming API\'S isn\'t what a beginner in a language rushes into.  Thanks for your understanding. ', 13, '2020-05-05', 'Good', 1, 'Intermediate'),
(905, 'kvuti10@gmail.com', 'backend', 'https://repl.it/@Blazingkevin/day-5', 'Day 5', '', 13, '2020-05-05', 'Good clean code. This was the solution I came up with on first try for this question. But it is not the optimal. Since we are looking for values A+B=num, A great solution though would be to for a to have all occurences of 7 be changed to say 5 and all other values changed to 0 while B having only all occurrences of 7 be changed to 2. Choosing 5 and 2 are not necessary but any two positive integers that add to 7. This would eliminate the need for subtraction for a very large integer.  Read more about it here.  https://codingcompetitions.withgoogle.com/codejam/round/0000000000051705/0000000000088231\r\nKeep up the good work.\r\n\r\n-Bee', 1, 'Intermediate'),
