(974, 'osagieiyayi09@gmail.com', 'backend', 'https://github.com/E-wave112/backend-day-5/blob/master/Beginner\'s%20level', 'Day 5', 'Baby Steps', 12, '2020-05-05', 'firstly, please make all future submissions to repl.it. Good clean code. If you study the triangle numbers though, you would notice that all triangle numbers have ((8*num)+1) as a perfect square. Simply checking for this would eliminate the need for for loops. Keep it up though. Your solution shows a good level of concentration and follow through which is needed for backend engineers.\r\n\r\n-Bee', 1, 'Beginner'),
(975, 'ellaystar1@gmail.com', 'frontend', 'https://github.com/emmanuellabubakar/30-days-of-code/', 'Day 5', '', 8, '2020-05-06', 'Great work. Few suggestions.\r\n\r\nYou can use better icons. The page has two search icons. It didnt also inspire me to tell me what it is about. Are you selling to the teacher or the student too cause the message sounds conflicting. No favicon too. Great work once again - Geek', 1, 'Beginner'),
(977, 'koikibabatunde14@gmail.com', 'backend', 'https://repl.it/@babatunde13/BackEndBeginner', 'Day 6', 'My file is in day6.py file and I imported it ij the main.py file', 13, '2020-05-06', 'Good work. Implementing your method shows a deep understanding of basic features of javascript. But your approach was not the optimal. Finding trailing zeroes simply has to do with finding the number of times a number can be divided by 10. With that in mind 10 is divisible by 5 and 2. Since the multiples of two are so numerous, it boils down to fining the multiples of 5 among the factorial digits without calculating the factorial. eg in 16!, the multiples of 5 in the list would be 5,10,15. Therefore, 16! has 3 trailing zeroes. You might want to try this out later. It would increase your understanding of how to use while statements. \r\n\r\n-Bee', 1, 'Beginner'),
(979, 'koikibabatunde14@gmail.com', 'backend', 'https://repl.it/@babatunde13/BackEndIntermediate', 'Day 6', 'My code is in day6.py file and I imported it in the main.py file', 13, '2020-05-06', 'Good Thought process. Your thought process could have been better implemented though. The application of modulus could have reduced your code by two else statements. instead of checking if the number after 3 or 10 has been added is less than the consonant or vowel, you could have just returned the modulus of the sum against 6 or 20. this would have given you the position of the encoded character without need for decision making.\r\n\r\n-Bee', 1, 'Intermediate'),
(984, 'devops@gmail.com', 'backend', 'https://repl.it/@lumiyke/day-6', 'Day 6', '', 13, '2020-05-06', 'Good work. Implementing your method shows a deep understanding of basic features of javascript. But your approach was not the optimal. Finding trailing zeroes simply has to do with finding the number of times a number can be divided by 10. With that in mind 10 is divisible by 5 and 2. Since the multiples of two are so numerous, it boils down to fining the multiples of 5 among the factorial digits without calculating the factorial. eg in 16!, the multiples of 5 in the list would be 5,10,15. Therefore, 16! has 3 trailing zeroes. You might want to try this out later. It would increase your understanding of how to use while statements. \r\n\r\n-Bee', 1, 'Beginner'),
