(1050, 'josephtobiad1@gmail.com', 'backend', 'https://repl.it/@josephtobi/factorial-zero', 'Day 6', '', 13, '2020-05-06', 'Good work. Implementing your method shows a deep understanding of basic features of javascript. But your approach was not the optimal. Finding trailing zeroes simply has to do with finding the number of times a number can be divided by 10. With that in mind 10 is divisible by 5 and 2. Since the multiples of two are so numerous, it boils down to fining the multiples of 5 among the factorial digits without calculating the factorial. eg in 16!, the multiples of 5 in the list would be 5,10,15. Therefore, 16! has 3 trailing zeroes. You might want to try this out later. It would increase your understanding of how to use while statements. \r\n\r\n-Bee', 1, 'Beginner'),
