(1099, 'ayomiposolaja@gmail.com', 'backend', 'https://repl.it/@solajaayomipo/Day6', 'Day 6', '', 14, '2020-05-06', 'Mehn, your code was long...Excellent job though. check this solution out. function isUppercase (str) {\r\n	return str.toUpperCase() === str;\r\n}\r\n\r\nfunction tongues (code) {\r\n	let test = code.toLowerCase();\r\n	let temp;\r\n	let returnStr = \'\';\r\n	let vowels = \'aiyeou\';\r\n	let consonants = \'bkxznhdcwgpvjqtsrlmf\';\r\n	for (let i = 0; i < code.length; i++) {\r\n		if(vowels.indexOf(test[i]) !== -1) {\r\n			temp = (vowels.indexOf(test[i]) + 3) % 6;\r\n			returnStr += isUppercase(code[i]) ? vowels[temp].toUpperCase() : vowels[temp]\r\n		} else if (consonants.indexOf(test[i]) !== -1) {\r\n			temp = (consonants.indexOf(test[i]) + 10) % 20;\r\n			returnStr += isUppercase(code[i]) ? consonants[temp].toUpperCase() : consonants[temp]\r\n		} else {\r\n			returnStr += code[i];\r\n		}\r\n	}	\r\n	return returnStr;\r\n}\r\n\r\nconsole.log(tongues(\'As a boss, I refuse to speak the tongue of Mortal Men\'));\r\n\r\n-Bee', 1, 'Intermediate'),
