(1298, 'kvuti10@gmail.com', 'backend', 'https://repl.it/@Blazingkevin/8thday', 'Day 8', '', 13, '2020-05-08', 'Your code was longer than necessary despite using the Number() function. Frankly, it was amongst the functions I wanted to ban at first, but I forgot to include it. \r\nfunction binToTen(num) {\r\n  return num.split(\'\').reverse().reduce(function(p, c, i) {return p + Math.pow(2, i) * c;}, 0);\r\n}\r\n\r\nfunction calculate(num1, num2) {\r\n  return binToTen(num1) + binToTen(num2);\r\n}\r\nThis is a solution without using Math inbuilt functions and Number().\r\n\r\n-Bee', 1, 'Intermediate'),
