(1592, 'osagieiyayi09@gmail.com', 'backend', 'https://repl.it/@ewave/DangerousDarkorchidCpu', 'Day 10', 'Muito Obrigado !', 12, '2020-05-10', 'The task was to create and print an object according to the format in the example given. \r\nLa tÃ¢che Ã©tait de crÃ©er et d\'imprimer un objet selon le format de l\'exemple donnÃ©. \r\n\r\nClean excellent code though, Keep it up. \r\nnettoyer un excellent code cependant, continuez comme Ã§a.\r\n\r\nyou may use this for reference\r\ndef validator(email, password):\r\n  res = {\r\n    \'email\': \'false\', \'password\': \'false\'\r\n  }\r\n  if any([x.islower() for x in password]) and any([x.isupper() for x in password]) and any([not x.isalnum() for x in password]) and any([x.isdigit() for x in password]) and len(password) >= 8: res[\'password\'] = \'true\'\r\n  before_at = email[:email.index(\'@\')]\r\n  after_at = email[email.index(\'@\'):]\r\n\r\n  if any([x.isprintable() for x in before_at]):\r\n    if (after_at.count(\'.\')==1 and 3<= len(after_at[after_at.index(\'.\'):]) <=4) or (after_at.count(\'.\')==2 and 7<= len(after_at[after_at.index(\'.\'):]) <=8) : res[\'email\'] = \'true\'\r\n\r\n\r\n  return res\r\n\r\n\r\nprint(validator(\"akinwandeakiboluwarin@gmai.lu.com\",\"YOucan\'tgetmyPassword2\"))\r\nprint(validator(\'sodiq.agunbiade.4@gmail.com\', \'sh  jWUdh\'))\r\nprint(validator(\'tem.12ibami@msu.edu.co\', \'swhgdsbSAgs123\'))', 1, 'Intermediate'),
