(111, 8, 'mobile', '<p>Event app UI.</p>\r\n<p>Be creative. You might want to check uplabs.com, dribbble.com for inspiration</p>', 'Intermediate'),
(113, 9, 'python', '<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\"><strong>Adjacency - Matrix</strong></h1>\r\n<p>An adjacency dictionary is a collection of key &amp; value pairs where the keys refer to the nodes in a graph and the values are dictionaries containing the outgoing edges as keys and weight as values. <br />For example if we have: adj_dict= {\"A\": {\"B\":1}, \"B\":{\"C\":2}, \"C\":{\"A\":1,\"D\":1}, \"D\":{}}<br />This means that the node \"A\" points to the node \"B\" with a weight of 1, node \"B\" to the node \"C\" with a weight of 2, node \"C\" to the nodes \"A\" and \"D\" with weights of 1 and 1 and node \"D\" to nothing.<br />A sparse matrix is one that contains a majority of zero entries. For this purpose it shall be a list of lists where each sub list is a row. The row and column indices represent all nodes in alphabetical order. The column is the start node and the row is where it points to. An element in the matrix will have a corresponding to the weight if the column index maps to its row index from the adjacency dictionary. Thus the above dictionary transforms to :<br />&nbsp; &nbsp;A B&nbsp; C D<br />[ [0, 0, 1, 0], A<br />[1, 0, 0, 0],&nbsp; &nbsp;B<br />[0, 2, 0, 0],&nbsp; &nbsp;C<br />[0, 0, 1, 0] ]&nbsp; D<br /><br />Armed with this knowledge, write a function named sparsify that takes in an adjacency dictionary and returns the corresponding sparse matrix as a list of lists.<br />Example: sparsify({\"A\":{\"B: 2,\"D\":4}, \"B\": {\"C\": 1}, \"C\": {\"A\": 3, \"D\": 1}, \"D\": {\"B\": 1}}) returns<br />[[0, 0, 3, 0], [2, 0, 0, 1], [0, 1, 0, 0], [4, 0, 1, 0]]<br />N.B:<br />&bull; Weights are strictly integers and nodes are uppercase letters.<br />&bull;No inbuilt module should be used<br />&bull;Raise only AssertionErrors.<!--/data/user/0/com.samsung.android.app.notes/files/clipdata/clipdata_200509_001646_772.sdoc--></p>', 'Intermediate'),
(114, 9, 'python', '<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\"><strong>Adjacency - Matrix</strong></h1>\r\n<p>An adjacency dictionary is a collection of key &amp; value pairs where the keys refer to the nodes in a graph and the values are dictionaries containing the outgoing edges as keys and weight as values. <br />For example if we have: adj_dict= {\"A\": {\"B\":1}, \"B\":{\"C\":2}, \"C\":{\"A\":1,\"D\":1}, \"D\":{}}<br />This means that the node \"A\" points to the node \"B\" with a weight of 1, node \"B\" to the node \"C\" with a weight of 2, node \"C\" to the nodes \"A\" and \"D\" with weights of 1 and 1 and node \"D\" to nothing.<br />A sparse matrix is one that contains a majority of zero entries. For this purpose it shall be a list of lists where each sub list is a row. The row and column indices represent all nodes in alphabetical order. The column is the start node and the row is where it points to. An element in the matrix will have a corresponding to the weight if the column index maps to its row index from the adjacency dictionary. Thus the above dictionary transforms to :<br />&nbsp; &nbsp;A B&nbsp; C D<br />[ [0, 0, 1, 0], A<br />[1, 0, 0, 0],&nbsp; &nbsp;B<br />[0, 2, 0, 0],&nbsp; &nbsp;C<br />[0, 0, 1, 0] ]&nbsp; D<br /><br />Armed with this knowledge, write a function named sparsify that takes in an adjacency dictionary and returns the corresponding sparse matrix as a list of lists.<br />Example: sparsify({\"A\":{\"B: 2,\"D\":4}, \"B\": {\"C\": 1}, \"C\": {\"A\": 3, \"D\": 1}, \"D\": {\"B\": 1}}) returns<br />[[0, 0, 3, 0], [2, 0, 0, 1], [0, 1, 0, 0], [4, 0, 1, 0]]<br />N.B:<br />&bull; Weights are strictly integers and nodes are uppercase letters.<br />&bull;No inbuilt module should be used<br />&bull;Raise only AssertionErrors.<!--/data/user/0/com.samsung.android.app.notes/files/clipdata/clipdata_200509_001646_772.sdoc--></p>', 'Intermediate'),
(115, 9, 'python', '<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\"><strong>Adjacency - Matrix</strong></h1>\r\n<p>An adjacency dictionary is a collection of key &amp; value pairs where the keys refer to the nodes in a graph and the values are dictionaries containing the outgoing edges as keys and weight as values. <br />For example if we have: adj_dict= {\"A\": {\"B\":1}, \"B\":{\"C\":2}, \"C\":{\"A\":1,\"D\":1}, \"D\":{}}<br />This means that the node \"A\" points to the node \"B\" with a weight of 1, node \"B\" to the node \"C\" with a weight of 2, node \"C\" to the nodes \"A\" and \"D\" with weights of 1 and 1 and node \"D\" to nothing.<br />A sparse matrix is one that contains a majority of zero entries. For this purpose it shall be a list of lists where each sub list is a row. The row and column indices represent all nodes in alphabetical order. The column is the start node and the row is where it points to. An element in the matrix will have a corresponding to the weight if the column index maps to its row index from the adjacency dictionary. Thus the above dictionary transforms to :<br />&nbsp; &nbsp;A B&nbsp; C D<br />[ [0, 0, 1, 0], A<br />[1, 0, 0, 0],&nbsp; &nbsp;B<br />[0, 2, 0, 0],&nbsp; &nbsp;C<br />[0, 0, 1, 0] ]&nbsp; D<br /><br />Armed with this knowledge, write a function named sparsify that takes in an adjacency dictionary and returns the corresponding sparse matrix as a list of lists.<br />Example: sparsify({\"A\":{\"B: 2,\"D\":4}, \"B\": {\"C\": 1}, \"C\": {\"A\": 3, \"D\": 1}, \"D\": {\"B\": 1}}) returns<br />[[0, 0, 3, 0], [2, 0, 0, 1], [0, 1, 0, 0], [4, 0, 1, 0]]<br />N.B:<br />&bull; Weights are strictly integers and nodes are uppercase letters.<br />&bull;No inbuilt module should be used<br />&bull;Raise only AssertionErrors.<!--/data/user/0/com.samsung.android.app.notes/files/clipdata/clipdata_200509_001646_772.sdoc--></p>', 'Intermediate'),
(116, 10, 'backend', '<p>Day 10: Simple signup validator</p>\r\n<p>Write a function that takes in 2 strings. The first one is the email address, the second one is the password and returns an object specified below.</p>\r\n<p>Verify that the email adress is valid. If valid, create an object with property \"email\" and assign as true else, assign as false. For the password verify that it has at least one Uppercase letter, at least one lowercase letter, at least one non-alphanumeric character, at least one number and at least 8 character long. if the password is valid, let the object have property \"password\" assigned to true else, false.</p>\r\n<p>Example</p>\r\n<p>validate(\"akinwandeakiboluwarin@gmail.com\",\"YOucan\'tgetmyPassword2\")==={</p>\r\n<p>email: true,</p>\r\n<p>password:true</p>\r\n<p>}</p>\r\n<p>validate(\"ichigokurosaki@gmail.com\",\"getsugaTensho\")==={</p>\r\n<p>email: true,</p>\r\n<p>password:false</p>\r\n<p>}</p>\r\n<p>validate(\"ichigokurosakigmail.com\",\"getsugaTensho\")==={</p>\r\n<p>email: false,</p>\r\n<p>password:false</p>\r\n<p>}</p>', 'Beginner'),
(117, 10, 'backend', '<p>Day 10: Simple signup validator (gulp of redbull)</p>\r\n<p>Write a function that takes in 2 strings. The first one is the email address, the second one is the password and returns an object specified below.</p>\r\n<p>Without using regex, verify that the email adress is valid. If valid, create an object with property \"email\" and assign as true else, assign as false. For the password verify that it has at least one Uppercase letter, at least one lowercase letter, at least one non-alphanumeric character, at least one number and at least 8 character long. if the password is valid, let the object have property \"password\" assigned to true else, false.</p>\r\n<p>Example</p>\r\n<p>validate(\"akinwandeakiboluwarin@gmail.com\",\"YOucan\'tgetmyPassword2\")==={</p>\r\n<p>email: true,</p>\r\n<p>password:true</p>\r\n<p>}</p>\r\n<p>validate(\"ichigokurosaki@gmail.com\",\"getsugaTensho\")==={</p>\r\n<p>email: true,</p>\r\n<p>password:false</p>\r\n<p>}</p>\r\n<p>validate(\"ichigokurosakigmail.com\",\"getsugaTensho\")==={</p>\r\n<p>email: false,</p>\r\n<p>password:false</p>\r\n<p>}</p>', 'Intermediate'),
(118, 9, 'backend', '<p>Day 9 Date tastes.</p>\r\n<p>Write a function that returns an object&nbsp; containing the current date in the form</p>\r\n<p>{</p>\r\n<p>v1: dd/mm/yy,</p>\r\n<p>v2: mm/dd/yy</p>\r\n<p>}</p>', 'Beginner'),
(119, 9, 'backend', '<p>Day 9 Na-Ru-To</p>\r\n<p>Write a function that takes in an integer and returns an array with elements described below:</p>\r\n<p>For every number between 1 and the input argument included, check if&nbsp; the number is divisible by 2,3 or 5. If the number is divisible by 2, the number is replaced by Na. If the number is divisible by 3, it is replaced by Ru. If the number is divisible by 5 it is replaced by To. Numbers that are divisible by more than one of these numbers are replaced by the individual syllables separated by a hyphen. eg 6 is replaced by \"Na-Ru\", 10 is replaced by \"Na-To\". 30 is replaced by \"Na-Ru-To\". Numbers that are not divisible by these numbers remain as is. The output is an array with the arrangement of the replacement elements maintaining their original numerical order. 1 is included.</p>\r\n<p>Example:</p>\r\n<p>naruto(10)===[1,\'Na\',\'Ru\',\'Na\',\'To\',\'Na-Ru\',7,\'Na\',\'Ru\',\'Na-To\']</p>\r\n<p>&nbsp;</p>', 'Intermediate'),
(120, 9, 'frontend', '<p><strong>Create a Memory game of Matching Cards with the following features;</strong></p>\r\n<p>1. It should have a countdown timer</p>\r\n<p>2. It should have reset button</p>\r\n<p>3. It should display the total number of moves when the game is completed</p>\r\n<p>4. Your card layout should have at least 16 cards arranged in the 4x4 order</p>\r\n<p><strong>Demo Link</strong>:&nbsp;<a href=\"https://www.mathsisfun.com/games/card-match-game.html\">https://www.mathsisfun.com/games/card-match-game.html</a></p>\r\n<p>&nbsp;</p>', 'Intermediate'),
(121, 9, 'frontend', '<h3 id=\"docs-internal-guid-94ad973b-7fff-79fb-9397-37c330ce9743\" dir=\"ltr\" style=\"line-height: 2.2153799999999997; text-align: justify; background-color: #ffffff; margin-top: 18pt; margin-bottom: 0pt; padding: 0pt 0pt 18pt 0pt;\"><span style=\"font-size: 16pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Restaurant Website</span></h3>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Roboto; background-color: #ffffff; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Showcase your solid knowledge of HTML and CSS creating a beautiful webpage for a restaurant.You can add pictures gallery for different food items, you can also add sliding images for a better look. Add links for redirection to internal pages. Make it responsive setting a viewport, using media queries and grid. You can take help from </span><a style=\"text-decoration-line: none;\" href=\"https://jolly-kalam-23776e.netlify.com/restaurantwebsite/\"><span style=\"font-size: 12pt; font-family: Roboto; color: #1155cc; background-color: #ffffff; font-weight: bold; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">https://jolly-kalam-23776e.netlify.com/restaurantwebsite/</span></a></p>', 'Beginner'),
(122, 10, 'frontend', '<h3 id=\"docs-internal-guid-b928bafe-7fff-65a0-8f17-cf5572401b6e\" dir=\"ltr\" style=\"line-height: 2.2153799999999997; text-align: justify; background-color: #ffffff; margin-top: 18pt; margin-bottom: 0pt; padding: 0pt 0pt 18pt 0pt;\"><span style=\"font-size: 16pt; font-family: Arial; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Personal Portfolio</span></h3>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 16pt; font-family: Arial; background-color: #ffffff; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Showcase your work samples and skills in your portfolio with your name and pictures. You can also add your CV there, In your header section mention some menus like about, contact, work or services. At the top add one of your images and introduce yourself there. Below that add some work samples and at last (footer) add contact information or social media account. You can take help from the </span><a style=\"text-decoration-line: none;\" href=\"https://codepen.io/freeCodeCamp/full/zNBOYG\"><span style=\"font-size: 16pt; font-family: Arial; color: #1155cc; background-color: #ffffff; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">https://codepen.io/freeCodeCamp/full/zNBOYG</span></a></p>', 'Beginner'),
(123, 11, 'frontend', '<p id=\"docs-internal-guid-588622cf-7fff-5ccb-dac4-9ff5c4983fde\" dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 16pt; font-family: Arial; background-color: #ffffff; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">An Image Gallery with at least 6 pictures, using CSS GRID and flex property. Note that</span><span style=\"background-color: #ffffff; font-family: Arial; font-size: 16pt; white-space: pre-wrap;\">y are submitting 2 websites, create a repository, then create two folders in it, one for grid the other for flex. Each folder should have it\'s own readMe with the hosted link.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"background-color: #ffffff; font-family: Arial; font-size: 16pt; white-space: pre-wrap;\">May the Codes be with you.</span></p>', 'Beginner'),
(124, 12, 'frontend', '<p id=\"docs-internal-guid-88a61a5f-7fff-3a63-e502-91d1da459846\" dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 16pt; font-family: Arial; background-color: #ffffff; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Your task is to implement this landing page, it is not a must it looks exactly the same just make something close to this.</span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 16pt; font-family: Arial; background-color: #ffffff; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Note that the page must be responsive, be creative and design the mobile view the way you like it.</span></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 16pt; font-family: Arial; background-color: #ffffff; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">You can use any image or iconc you like.. here are some images you can use if you like </span><a style=\"text-decoration-line: none;\" href=\"https://drive.google.com/folderview?id=1ZmsgfPI3--J9PyCxKFP6gury5dUl_tRv\"><span style=\"font-size: 16pt; font-family: Arial; color: #1155cc; background-color: #ffffff; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">https://drive.google.com/folderview?id=1ZmsgfPI3--J9PyCxKFP6gury5dUl_tRv</span></a></p>\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 16pt; font-family: Arial; background-color: #ffffff; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">UI design :- </span><a style=\"text-decoration-line: none;\" href=\"https://www.uistore.design/items/mobile-app-landing-page/\"><span style=\"font-size: 16pt; font-family: Arial; color: #1155cc; background-color: #ffffff; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; text-decoration-skip-ink: none; vertical-align: baseline; white-space: pre-wrap;\">https://www.uistore.design/items/mobile-app-landing-page/</span></a></p>\r\n<p>&nbsp;</p>', 'Beginner'),
(125, 9, 'ui', '<p>Create 3 splash screens for a mobile app; Relating to education</p>', 'Beginner'),
(126, 9, 'mobile', '<p>You are to implement the basic flutter counter app. This time around, two floating action button. 1 for increase and the other for decrease.</p>', 'Beginner'),
(127, 9, 'mobile', '<p>Congrats, your events app UI was awesome and you have successfully joined ECX as a mobile developer. You pay is 15 marks per milestone.<br /><br />You are to build a mobile app for ECX. The app should have a landing/home screen. Other screens include team screen, an about us screen and the event screen you built last time.<br /><br />For this milestone, you are to implement the landing/home screen and the about screen.<br /><br />Please note that you\'ll be working on the same repo for the next x number of days. You will be adding the milestones/tasks as stated in the challenge.</p>\r\n<p>&nbsp;</p>\r\n<p>Be creative with your UI. Drawers, bottom navigation bar....... Whatever makes your UI standout</p>', 'Intermediate'),
(128, 9, 'ui', '<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">Design an e-commerce app (you\'re free to choose the products it sells) and prototype the user flow from signing up, choosing a product, adding it to the cart, viewing the cart, adding shipping info, adding a payment option and checking out.&nbsp;</p>\r\n<h2 style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">For Submission</h2>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\"><strong style=\"margin: 0px; padding: 0px;\">FIGMA&nbsp;</strong>Upload the prototyped figma link (anything not the prototyped link will be marked as 1 and no review will be granted).</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\"><strong style=\"margin: 0px; padding: 0px;\">ADOBE XD&nbsp;</strong>Share link for User testing (anything not the prototyped link will be marked as 1 and no review will be granted).</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\"><strong style=\"margin: 0px; padding: 0px;\">*</strong><span style=\"margin: 0px; padding: 0px; text-decoration-line: underline;\"><strong style=\"margin: 0px; padding: 0px;\">PLEASE FOLLOW SUBMISSION INSTRUCTIONS</strong></span></p>', 'Intermediate'),
(129, 10, 'python', '<p style=\"text-align: center;\"><strong>OOPs</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Contrary to what the title implies, this task was not a mistake.</p>\r\n<p>OOP==Object Oriented Programming</p>\r\n<p>&nbsp;</p>\r\n<p>Create a class&nbsp;<strong>Student</strong>.</p>\r\n<p>Every student has an <strong>age</strong>, <strong>weight </strong>and <strong>height</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Create a constructor that takes in 3 parameters, a students <strong>age,weight and height(in that order)</strong></p>\r\n<p>and <strong>initializes them to those values</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Create a <strong>function info() </strong>which when called by a <strong>student object RETURNS</strong>&nbsp;<strong>a tuple containing the age and Body Max Index(BMI)(rounded to 2dp) of the student</strong></p>\r\n<p><strong>BMI=weight/(height**2)</strong></p>\r\n<p>The function info() will not take any parameters</p>\r\n<p>&nbsp;</p>\r\n<p>Lastly create a <strong>function average() </strong>which takes a <strong>list of student objects </strong>and <strong>RETURNS a tuple containing the average age,weight and height(in that order) of the students</strong> in the <strong>next 10 years</strong></p>\r\n<p>i.e 10 years from now what would be their average age,weight and height(in that order)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Assume that weight increases by 5% each year and height increases by 2% each year.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>NOTE:</strong></p>\r\n<p>&bull;Age is an integer, weight and height are floats</p>\r\n<p>&bull;Ensure functions take parameters in the order given.</p>\r\n<p>&bull;Your float answers should be rounded to 2 dp</p>\r\n<p>&bull;Only assertion errors should be raised if necessary</p>\r\n<p>&nbsp;</p>\r\n<p>e.g</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Fortune=Student</strong>(23,45.67,7.6)</p>\r\n<p>represents a student whose age is 23, weight is 45.67 and height is 7.6</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Fortune.info()</strong> would return (23,0.79)</p>\r\n<p>&nbsp;</p>\r\n<p>another student</p>\r\n<p><strong>Joba=Student</strong>(22,40.01,8.3)</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>average</strong>([Fortune,Joba]) would return (32.5,69.78,9.69)</p>\r\n<p>&nbsp;</p>\r\n<p>e.g for weight in 10 years Joba will weigh 65.17 while Fortune will weigh 74.39 and the average of that is 69.78</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Goodluck. Sorry for the long epistle.</p>', 'Intermediate'),
(130, 10, 'frontend', '<p>You work for a company that has decided to introduce new pricing plans (Bronze, Silver, and Gold). The UI designer has come up with the new designs for the pricing plans page, however the APIs for the new plans is not ready. As a frontend developer, build a one page application that allows a user to subscribe to one of the new plans (borrow from any pricing plans design) whilst mocking the expected response from the API.</p>', 'Intermediate'),
(131, 11, 'frontend', '<p>Using the response obtained from https://jsonplaceholder.typicode.com/users get at least 3 properties of the object returned. Frameworks and Libraries are allowed.&nbsp;</p>\r\n<p>Api - https://jsonplaceholder.typicode.com/users<br />Demo - https://robosfriend.netlify.app/</p>', 'Intermediate'),
(132, 12, 'frontend', '<p>Using a weather api get the current weather. Frameworks and Libraries are allowed. <br />Api can be gotten from https://openweathermap.org/current<br />Demo - https://bamiogunfemi.github.io/weather-app/</p>', 'Intermediate'),
(133, 13, 'frontend', '<p>Using a Jokes api generate a random joke after 20 sec. Frameworks and Libraries are allowed. <br /><strong>Api - https://rapidapi.com/Sv443/api/jokeapi-v2?endpoint=apiendpoint_e5399e8c-6633-4c02-8063-42e2dd17e9fe</strong><br /><strong>Demo - https://fungenerators.com/random/joke</strong></p>', 'Intermediate'),
(134, 10, 'python', '<p><span style=\"text-decoration: underline;\"><strong>Optimal Fibonacci</strong></span></p>\r\n<p>Create a function named fibonaccit hat returns True if a number is in the fibonacci sequence and False if otherwise. It returns Wrong input if number is negative and Invalid if input isn\'t an integer. You\'re to use the optimal solution to solve this task.</p>\r\n<p>N/B: This task mainly test for complexity. If your code is slow for a very large number please don\'t submit it.</p>\r\n<p><strong>Sample Input</strong></p>\r\n<p><strong>fibonacci(2)==True</strong></p>\r\n<p><strong>fibonacci(-5)==Wrong input</strong></p>\r\n<p><strong>fibonacci([\'a\'])==Invalid</strong></p>\r\n<p>&nbsp;</p>', 'Beginner'),
(135, 10, 'backend', '', 'Beginner');
INSERT INTO `task` (`id`, `task_day`, `track`, `task`, `level`) VALUES
(143, 11, 'backend', '<p>Day 11: Keeping it a hundred</p>\r\n<p><span style=\"font-family: sans-serif;\">Write a function that outputs all the possible ways of putting </span><code style=\"font-family: Consolas, Inconsolata, Monaco, monospace;\">+</code><span style=\"font-family: sans-serif;\">&nbsp;or&nbsp;</span><code style=\"font-family: Consolas, Inconsolata, Monaco, monospace;\">-</code><span style=\"font-family: sans-serif;\"> or nothing between the numbers 1,2,&hellip;,9 (in this order) such that the result is 100 as strings. keeping 1 as positive always</span></p>\r\n<p><span style=\"font-family: sans-serif;\">For example 1 + 2 + 3 - 4 + 5 + 6 + 78 + 9 = 100.</span></p>', 'Intermediate'),
(136, 10, 'mobile', '<p>&nbsp;</p>\r\n<table class=\"table\" style=\"margin: 0px; padding: 0px; color: #3c3c3f; border: 1px solid #cccccc; width: 950px; font-family: Arial, Helvetica, sans-serif;\">\r\n<tbody style=\"margin: 0px; padding: 0px;\">\r\n<tr style=\"margin: 0px; padding: 0.35em; background-color: #f8f8f8; border: 1px solid #dddddd;\">\r\n<td style=\"margin: 0px; padding: 0.625em;\" data-label=\"Task\">\r\n<p style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Day 10: Perfect Square</strong></p>\r\n<p style=\"margin: 0px; padding: 0px;\">Create a function&nbsp;<strong style=\"margin: 0px; padding: 0px;\">is_perfect_square</strong>&nbsp;that takes a parameter number and checks if the number is a perfect square. It should return True if the number is a perfect square and False if otherwise.</p>\r\n<p style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Sample Inputs</strong></p>\r\n<p style=\"margin: 0px; padding: 0px;\">1) is_perfect_square(9)</p>\r\n<p style=\"margin: 0px; padding: 0px;\">2) is_perfect_square(100)</p>\r\n<p style=\"margin: 0px; padding: 0px;\">3) is_perfect_square(225)</p>\r\n<p style=\"margin: 0px; padding: 0px;\">4) is_perfect_square(500)</p>\r\n<p style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">Sample Output</strong></p>\r\n<p style=\"margin: 0px; padding: 0px;\">1) True</p>\r\n<p style=\"margin: 0px; padding: 0px;\">2) True</p>\r\n<p style=\"margin: 0px; padding: 0px;\">3) True</p>\r\n<p style=\"margin: 0px; padding: 0px;\">4) False</p>\r\n<p style=\"margin: 0px; padding: 0px;\"><strong style=\"margin: 0px; padding: 0px;\">NB: The in built square root and raised to power operator should not be used.</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>', 'Beginner'),
(137, 10, 'mobile', '<p>Yesterday, you completed the given milestone and got paid. Today, you are to create a team screen for the application. You could use dummy names and images.</p>\r\n<p>Be creative.</p>', 'Intermediate'),
(138, 10, 'ui', '<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">Finish designing and prototyping your app from yesterday</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">\"Design an e-commerce app (you\'re free to choose the products it sells) and prototype the user flow from signing up, choosing a product, adding it to the cart, viewing the cart, adding shipping info, adding a payment option and checking out.\"</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">&nbsp;</p>\r\n<h2 style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">For Submission</h2>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\"><strong style=\"margin: 0px; padding: 0px;\">FIGMA&nbsp;</strong>Upload the prototyped figma link (anything not the prototyped link will be marked as 1 and no review will be granted).</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\"><strong style=\"margin: 0px; padding: 0px;\">ADOBE XD&nbsp;</strong>Share link for User testing (anything not the prototyped link will be marked as 1 and no review will be granted).</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">&nbsp;</p>\r\n<p><!--(figmeta)eyJmaWxlS2V5IjoiUlNtdzBUR0NmS0t6VFdydmNGOXE0USIsInBhc3RlSUQiOjUxNDc2MzgyNiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)--><!--(figma)(/figma)--><!--(figmeta)eyJmaWxlS2V5IjoiUlNtdzBUR0NmS0t6VFdydmNGOXE0USIsInBhc3RlSUQiOjUxNDc2MzgyNiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)--><!--(figma)(/figma)--><!--(figmeta)eyJmaWxlS2V5IjoiUlNtdzBUR0NmS0t6