(139, 10, 'ui', '<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">Finish designing and prototyping your app from yesterday</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">\"Design an e-commerce app (you\'re free to choose the products it sells) and prototype the user flow from signing up, choosing a product, adding it to the cart, viewing the cart, adding shipping info, adding a payment option and checking out.\"</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">&nbsp;</p>\r\n<h2 style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">For Submission</h2>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\"><strong style=\"margin: 0px; padding: 0px;\">FIGMA&nbsp;</strong>Upload the prototyped figma link (anything not the prototyped link will be marked as 1 and no review will be granted).</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\"><strong style=\"margin: 0px; padding: 0px;\">ADOBE XD&nbsp;</strong>Share link for User testing (anything not the prototyped link will be marked as 1 and no review will be granted).</p>\r\n<p style=\"margin: 0px; padding: 0px; color: #3c3c3f; font-family: Arial, Helvetica, sans-serif; background-color: #f8f8f8;\">&nbsp;</p>\r\n<p><!--(figmeta)eyJmaWxlS2V5IjoiUlNtdzBUR0NmS0t6VFdydmNGOXE0USIsInBhc3RlSUQiOjUxNDc2MzgyNiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)--><!--(figma)(/figma)--><!--(figmeta)eyJmaWxlS2V5IjoiUlNtdzBUR0NmS0t6VFdydmNGOXE0USIsInBhc3RlSUQiOjUxNDc2MzgyNiwiZGF0YVR5cGUiOiJzY2VuZSJ9Cg==(/figmeta)--><!--(figma)(/figma)--><!--(figmeta)eyJmaWxlS2V5IjoiUlNtdzBUR0NmS0t6