(141, 11, 'python', '<p style=\"color: #111111; font-family: \'Segoe UI\', Arial, sans-serif; font-size: 16.72px;\"><span style=\"text-decoration: underline;\"><strong>SUMSQUARE</strong></span></p>\r\n<p style=\"color: #111111; font-family: \'Segoe UI\', Arial, sans-serif; font-size: 16.72px;\">The sum of the squares of the first ten natural numbers is&nbsp;<span id=\"MathJax-Element-1-Frame\" class=\"MathJax\" style=\"display: inline; line-height: normal; font-size: 16.72px; word-spacing: normal; overflow-wrap: normal; white-space: nowrap; float: none; direction: ltr; max-width: none; max-height: none; min-width: 0px; min-height: 0px; border: 0px; padding: 0px; margin: 0px; position: relative;\" tabindex=\"0\" role=\"presentation\" data-mathml=\"&lt;math xmlns=\">1**2+2**2+...+10**2 = 385<span id=\"MathJax-Span-1\" class=\"math\" style=\"transition: none 0s ease 0s; display: inline-block; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; width: 11.812em;\"><span style=\"transition: none 0s ease 0s; display: inline-block; position: relative; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; width: 10.162em; height: 0px; font-size: 19.3952px;\"><span style=\"transition: none 0s ease 0s; position: absolute; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; clip: rect(1.292em, 1010.09em, 2.581em, -999.98em); top: -2.318em; left: 0em;\"><span id=\"MathJax-Span-2\" class=\"mrow\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box;\"><span id=\"MathJax-Span-3\" class=\"msubsup\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box;\"><span style=\"transition: none 0s ease 0s; display: inline-block; position: relative; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; width: 0.931em; height: 0px;\"><span style=\"transition: none 0s ease 0s; position: absolute; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; clip: rect(3.2em, 1000.45em, 4.18em, -999.98em); top: -4.02em; left: 0em;\"><span id=\"MathJax-Span-4\" class=\"mn\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">1</span></span><span style=\"transition: none 0s ease 0s; position: absolute; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; top: -4.432em; left: 0.518em;\"><span id=\"MathJax-Span-5\" class=\"mn\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-size: 13.7124px; font-family: MathJax_Main;\">2</span></span></span></span><span id=\"MathJax-Span-6\" class=\"mo\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px 0px 0px 0.209em; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">+</span><span id=\"MathJax-Span-7\" class=\"msubsup\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px 0px 0px 0.209em; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box;\"><span style=\"transition: none 0s ease 0s; display: inline-block; position: relative; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; width: 0.931em; height: 0px;\"><span style=\"transition: non