ox-sizing: content-box; font-family: MathJax_Main;\">=</span><span id=\"MathJax-Span-19\" class=\"mn\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px 0px 0px 0.26em; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">385</span></span></span></span></span></span></p>\r\n<p style=\"color: #111111; font-family: \'Segoe UI\', Arial, sans-serif; font-size: 16.72px;\">The square of the sum of the first ten natural numbers is,&nbsp;<span id=\"MathJax-Element-2-Frame\" class=\"MathJax\" style=\"display: inline; line-height: normal; font-size: 16.72px; word-spacing: normal; overflow-wrap: normal; white-space: nowrap; float: none; direction: ltr; max-width: none; max-height: none; min-width: 0px; min-height: 0px; border: 0px; padding: 0px; margin: 0px; position: relative;\" tabindex=\"0\" role=\"presentation\" data-mathml=\"&lt;math xmlns=\">(1+2+...+10)**2 = 55**2 = 3025<span id=\"MathJax-Span-20\" class=\"math\" style=\"transition: none 0s ease 0s; display: inline-block; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; width: 15.473em;\"><span style=\"transition: none 0s ease 0s; display: inline-block; position: relative; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; width: 13.307em; height: 0px; font-size: 19.3952px;\"><span style=\"transition: none 0s ease 0s; position: absolute; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; clip: rect(1.292em, 1013.24em, 2.736em, -999.98em); top: -2.318em; left: 0em;\"><span id=\"MathJax-Span-21\" class=\"mrow\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box;\"><span id=\"MathJax-Span-22\" class=\"mo\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">(</span><span id=\"MathJax-Span-23\" class=\"mn\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">1</span><span id=\"MathJax-Span-24\" class=\"mo\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px 0px 0px 0.209em; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">+</span><span id=\"MathJax-Span-25\" class=\"mn\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px 0px 0px 0.209em; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">2</span><span id=\"MathJax-Span-26\" class=\"mo\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">+</span><span id=\"MathJax-Span-27\" class=\"mo\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">.</span><span id=\"MathJax-Span-28\" class=\"mo\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px 0px 0px 0.157em; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">.</span><span id=\"MathJax-Span-29\" class=\"mo\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px 0px 0px 0.157em; margin: 0px; vertical-align: 0px; li