x; font-size: 13.7124px; font-family: MathJax_Main;\">2</span></span></span></span><span id=\"MathJax-Span-35\" class=\"mo\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px 0px 0px 0.26em; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">=</span><span id=\"MathJax-Span-36\" class=\"msubsup\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px 0px 0px 0.26em; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box;\"><span style=\"transition: none 0s ease 0s; display: inline-block; position: relative; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; width: 1.447em; height: 0px;\"><span style=\"transition: none 0s ease 0s; position: absolute; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; clip: rect(3.2em, 1000.97em, 4.18em, -999.98em); top: -4.02em; left: 0em;\"><span id=\"MathJax-Span-37\" class=\"mn\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">55</span></span><span style=\"transition: none 0s ease 0s; position: absolute; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; top: -4.432em; left: 0.982em;\"><span id=\"MathJax-Span-38\" class=\"mn\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-size: 13.7124px; font-family: MathJax_Main;\">2</span></span></span></span><span id=\"MathJax-Span-39\" class=\"mo\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px 0px 0px 0.26em; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">=</span><span id=\"MathJax-Span-40\" class=\"mn\" style=\"transition: none 0s ease 0s; display: inline; position: static; border: 0px; padding: 0px 0px 0px 0.26em; margin: 0px; vertical-align: 0px; line-height: normal; box-sizing: content-box; font-family: MathJax_Main;\">3025</span></span></span></span></span></span></p>\r\n<p style=\"color: #111111; font-family: \'Segoe UI\', Arial, sans-serif; font-size: 16.72px;\">Hence the difference between the sum of the squares of the first ten natural numbers and the square of the sum is&nbsp; <span id=\"MathJax-Element-3-Frame\" class=\"MathJax\" style=\"display: inline; line-height: normal; font-size: 16.72px; word-spacing: normal; overflow-wrap: normal; white-space: nowrap; float: none; direction: ltr; max-width: none; max-height: none; min-width: 0px; min-height: 0px; border: 0px; padding: 0px; margin: 0px; position: relative;\" tabindex=\"0\" role=\"presentation\" data-mathml=\"&lt;math xmlns=\">3025 &minus; 385 = 2640</span></p>\r\n<p style=\"color: #111111; font-family: \'Segoe UI\', Arial, sans-serif; font-size: 16.72px;\">Create a function named squareSum that takes in a parameter n and returns the difference between the sum of the squares of the first nth natural numbers and the square of the sum.</p>\r\n<p style=\"color: #111111; font-family: \'Segoe UI\', Arial, sans-serif; font-size: 16.72px;\"><span style=\"text-decoration: underline;\"><strong>Sample Input</strong></span></p>\r\n<p style=\"color: #111111; font-family: \'Segoe UI\', Arial, sans-serif; font-size: 16.72px;\"><strong>squareSum(10)==2640</strong></p>\r\n<p style=\"color: #111111; font-family: \'Segoe UI\', Arial, sans-serif; font-size: 16.72px;\"><strong>squareSum(\'a\')==Invalid!</strong></p>\r\n<p style=\"color: #111111; font-family: \'Segoe UI\', Arial, sans-serif; font-size: 16.72px;\"><strong>squareSum(-19)==Wrong Input</strong></p>\r\n<p style=\"color: #111111; font-family: \'Segoe UI\', Arial, sans-serif; font-size: 16.72px;\"><strong>N/B: No built-in module is allowed.</strong></p>', 'Beginner'),
(148, 11, 'mobile', 'Portfolio App UI\r\nCreate a simple portfolio app UI.', 'Beginner'),
(142, 11, 'backend', '<p>Write a function that takes in two integers and returns the Greatest common Divisor/Highest common Factor between both of them. It is cumpulsory to use recursion. And your code must be well commented.</p>\r\n<p>Example</p>\r\n<p>hcf(2154, 458)===2</p>', 'Beginner'),
(144, 11, 'python', '<h1>Day 11: Double fold.</h1>\r\n<p><strong>Part I:</strong></p>\r\n<p><em><strong>Given a list of tokens</strong></em> (strings, integers or a combination) and <strong>a dictionary from token to token</strong>, write a function named&nbsp; <strong>resolve</strong> to resolve each token and <strong>return a list of the resolved tokens in the same order</strong>. Resolving a token means repeatedly searching for it as a key in the dictionary and replacing it with the associated value until it cannot be found in the dictionary as a key. If there is an infinite loop of values or it is not in the dictionary, you should resolve a token to itself.</p>\r\n<p><strong>For example</strong>, if the dictionary is d = {\'a\': \'b\', \'b\': \'c\', \'p\': \'q\', \'q\': \'p\'}, we resolve a to c, b to c, p to p, q to q, and z to z.</p>\r\n<p><strong>resolve</strong>(d, [\'a\',\'b\',\'p\',\'q\',\'z\']) returns [\'c\', \'c\', \'p\', \'q\', \'z\']</p>\r\n<p><strong>Explanation:</strong></p>\r\n<p>\'a\' maps to \'b\' which maps to \'c\' in the dictionary. c doesnt map to anything(i.e is not a key so it maps to itself)</p>\r\n<p>\'b\' maps to \'c\' which maps to itself</p>\r\n<p>\'p\' maps to \'q\' which maps to \'p\' which maps to \'q\' and it keeps going infinite;y. Hence we map \'p\' to itself</p>\r\n<p>\'q\' maps to \'q\' just like p described above</p>\r\n<p>\'z\' maps to itself as it isnt a key in the dictionary</p>\r\n<p>Another example</p>\r\n<p>d={\'a\':\'b\',\'b\':\'c\',\'c\':b}</p>\r\n<p><strong>resolve</strong>(d,[\'a\',\'b\']) returns [\'b\'.\'b\']</p>\r\n<p>explantion is a maps to \'b\' which maps to \'c\' which maps to \'b\' which maps to c(infinitely) so the answer is b</p>\r\n<p>for the reason described above b maps to b also.</p>\r\n<p>last example</p>\r\n<p>d={\'a\':\'b\',\'b:\'c\',\'c\':\'a\'}</p>\r\n<p><strong>resolve</strong>(d,[\'a\']) will return [\'a\']&nbsp;</p>\r\n<p>a maps to b which maps to c which maps back to a and the loop continues.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>All keys should be alphabetic and integers positive.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 14pt;\"><strong>Part II:</strong></span></p>\r\n<p>Bins are series of intervals that divide a range of integers into equal or unequal groups.</p>\r\n<p>Given<strong> a list of integers and a list of the lower limit of bins</strong>, write a function named <strong>bin</strong> to <strong>return the number of elements in each bin as a list.</strong></p>\r\n<p><strong>All integers are welcomed but the elements in the list of lower limit of bins should be in the range of the list of integers.</strong></p>\r\n<p>&nbsp;</p>\r\n<p>For example:</p>\r\n<p>Given list(range(100)) and [0, 10, 25, 45, 70], you should return [10,15,20,25,30]</p>\r\n<p>i.e <strong>bin</strong>(list(range(100)),[0,10,25,45,70]) will return [10,15,20,25,30]</p>\r\n<p><strong>bin</strong>([1,2,3,5,6,7,8,9,10,11,12],[2,5,10])&nbsp; should return [2,5,3]&nbsp; i.e 2 numbers between 2 and 5, 5 between 5 and 10 and 3 between 10 and infinity.</p>\r\n<p><span style=\"font-size: 14pt;\"><strong>NOTE:</strong></span></p>\r\n<p>&bull;No inbuilt module should be used.</p>\r\n<p>&bull;<strong>Raise AssertionErrors</strong> only.</p>', 'Intermediate'),
(145, 11, 'ui', '<p>Using the userflow you made in Day 8, Design an educational platform.</p>\r\n<h2 style=\"margin: 0px; padding: 0px; font-family: Arial, Helvetica, sans-serif; box-sizing: border-box; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: #3c3c3f; background-color: #f8f8f8;\">For Submission</h2>\r\n<p style=\"margin: 0px; padding: 0px; font-family: Arial, Helvetica, sans-serif; box-sizing: border-box; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: #3c3c3f; background-color: #f8f8f8;\"><strong style=\"margin: 0px; padding: 0px; font-family: Segoe, \'Segoe UI\', Tahoma, Geneva, Verdana, sans-serif; box-sizing: border-box; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">FIGMA&nbsp;</strong>Upload the figma link (anything not the link will be marked as 1 and no review will be granted).</p>\r\n<p style=\"margin: 0px; padding: 0px; font-family: Arial, Helvetica, sans-serif; box-sizing: border-box; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: #3c3c3f; background-color: #f8f8f8;\"><strong style=\"margin: 0px; padding: 0px; font-family: Segoe, \'Segoe UI\', Tahoma, Geneva, Verdana, sans-serif; box-sizing: border-box; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">ADOBE XD&nbsp;</strong>Share link for User testing (anything not the link will be marked as 1 and no review will be granted).</p>\r\n<p style=\"margin: 0px; padding: 0px; font-family: Arial, Helvetica, sans-serif; box-sizing: border-box; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: #3c3c3f; background-color: #f8f8f8;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; font-family: Arial, Helvetica, sans-serif; box-sizing: border-box; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); color: #3c3c3f; background-color: #f8f8f8;\"><strong style=\"margin: 0px; padding: 0px; font-family: Segoe, \'Segoe UI\', Tahoma, Geneva, Verdana, sans-serif; box-sizing: border-box; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\">*</strong><span style=\"margin: 0px; padding: 0px; font-family